		["Kingsbane Stacks"] = {
			["glow"] = false,
			["text1FontSize"] = 25,
			["xOffset"] = -110,
			["customText"] = "function()\n    return aura_env.stacks or \"\"\nend\n\n",
			["untrigger"] = {
				["custom"] = "function(_,_,type,_,source,_,_,_,dest,_,_,_,spell,_,_,_,stacks)\n    if not aura_env.active then        \n        return true\n    elseif type == \"SPELL_AURA_REMOVED\" and source == aura_env.guid(\"player\") and spell == aura_env.kings then\n        if aura_env.printStacks then aura_env.print(\"\\124cffFFF569Kingsbane Stacks Reached:\\124r \\124cff00c3ff\"..aura_env.stacks..\"\\124r\") end\n        aura_env.reset()\n        return true\n    end\nend",
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "----------------------------\n-- Print stacks achieved at \n-- the end of kingsbane?\naura_env.printStacks = true\n----------------------------\n-- Spell IDs\naura_env.ago    = 200803\naura_env.kings  = 192759\naura_env.deadly = 2818\naura_env.deadlydmg = 113780\n----------------------------\n-- Aura Information \naura_env.active = nil\naura_env.start  = nil\naura_env.poison = nil\naura_env.dest   = nil\naura_env.stacks = 0\naura_env.capped = false\naura_env.prev = nil\naura_env.curr = nil\n----------------------------\n-- Function Clones\naura_env.getTime = GetTime\naura_env.print = print\naura_env.guid = UnitGUID\n----------------------------\n-- Custom Functions\naura_env.getPoison = function()\n    local agonizing = UnitBuff(\"player\", GetSpellInfo(aura_env.ago))\n    --aura_env.message(\"aura_env.poison set to: [\"..(agonizing and \"Agonizing Poison\" or \"Deadly Poison\")..\"]\")\n    return agonizing and aura_env.ago or aura_env.deadly    \nend\naura_env.shift = function(exp)\n    aura_env.prev = aura_env.curr\n    aura_env.curr = exp\nend\naura_env.increment = function()\n    aura_env.stacks = aura_env.stacks + 1\n    aura_env.message(\"stacks incremented to \"..aura_env.stacks)\nend\naura_env.resetStacks = function()\n    aura_env.stacks = 0\n    aura_env.message(\"stacks reset to 0\")\nend\naura_env.set = function(dest)\n    aura_env.active = true\n    aura_env.start = aura_env.getTime()\n    aura_env.dest = dest\n    aura_env.message(\"variables set: {true, \"..dest..\", \"..aura_env.start..\"}\")\nend\naura_env.reset = function()\n    aura_env.active = nil\n    aura_env.start = nil\n    aura_env.dest = nil\n    aura_env.capped = false\n    aura_env.prev = nil\n    aura_env.curr = nil\n    aura_env.resetStacks()\n    aura_env.message(\"variables reset\")\nend\naura_env.message = function(...)\n    if aura_env.debug then\n        print(...)\n    end\nend\n----------------------------\n-- Misc\naura_env.debug = false",
					["do_custom"] = true,
				},
			},
			["text1Enabled"] = true,
			["selfPoint"] = "CENTER",
			["trigger"] = {
				["type"] = "custom",
				["custom_type"] = "event",
				["debuffType"] = "HELPFUL",
				["subeventPrefix"] = "SPELL",
				["event"] = "Health",
				["customStacks"] = "\n\n",
				["customDuration"] = "function()\n    if aura_env.active then return 14, aura_env.start + 14 end\nend\n\n",
				["names"] = {
				},
				["custom"] = "function(_,_,type,_,source,_,_,_,dest,_,_,_,spell,_,_,_,stacks)\n    aura_env.poison = aura_env.getPoison()\n    if type == \"SPELL_AURA_APPLIED\" and source == aura_env.guid(\"player\") and dest ~= aura_env.guid(\"player\") and spell == aura_env.kings then\n        local s = select(4, UnitDebuff(\"target\", GetSpellInfo(aura_env.ago), nil, \"PLAYER\"))\n        if s then \n            aura_env.message(\"agonizing stacks: \"..s) \n            if s == 5 then \n                local exp = select(7, UnitDebuff(\"target\", GetSpellInfo(aura_env.ago), nil, \"PLAYER\"))\n                aura_env.capped = true\n                aura_env.shift(exp)\n                aura_env.shift(exp)\n            end \n        end\n        aura_env.set(dest)\n        return true\n    elseif aura_env.active and aura_env.poison == aura_env.deadly \n    -- Test deadly poison\n    and (type == \"SPELL_AURA_APPLIED\" or type == \"SPELL_AURA_REFRESH\" or type == \"SPELL_DAMAGE\") \n    and source == aura_env.guid(\"player\") \n    and dest == aura_env.dest \n    and (spell == aura_env.deadly or spell == aura_env.deadlydmg) then\n        aura_env.increment() \n    elseif aura_env.active and aura_env.poison == aura_env.ago\n    -- Test agonizing poison\n    and (type == \"SPELL_AURA_APPLIED\" or type == \"SPELL_AURA_APPLIED_DOSE\") \n    and source == aura_env.guid(\"player\") \n    and dest == aura_env.dest \n    and (spell == aura_env.ago) then\n        if stacks == 5 then aura_env.capped = true aura_env.message(\"Agonizing Poison stacks capped\") end\n        local exp = select(7, UnitDebuff(\"target\", GetSpellInfo(aura_env.ago), nil, \"PLAYER\"))\n        aura_env.shift(exp)\n        aura_env.increment() \n    end\nend\n\n",
