			["customText"] = "function(progress, ...)\n    \n    local auraname = select(4, ...)\n    local duration = select(6, UnitAura(\"target\", auraname, nil, \"PLAYER|HARMFUL\")) or 0\n    \n    local refresh = duration*0.3 --- for the finisher specific formula refer to http://pastebin.com/jS6NdUY4\n    \n    \n    local remaining = progress - GetTime()\n    \n    if progress ~= 0 then\n        \n        if(remaining < refresh) then\n            \n            if(wa_GRsnapshot == true) then\n                \n                return \"|cFFE11F00\"..format(\"%.1f\",remaining)\n            else\n                return \"|cFF00FF00\"..format(\"%.1f\",remaining)\n                \n            end\n            \n            \n        else\n            \n            if(wa_GRsnapshot == true) then\n                \n                return \"|cFFE1A000\"..format(\"%.1f\",remaining) \n            else\n                return \"|cFFFFFFFF\"..format(\"%.1f\",remaining)\n            end\n            \n        end\n        \n    end\n    \nend\n\n\n\n\n\n\n\n",
